import { BrowserRouter, Route, Router, Routes } from "react-router-dom";
import Footerres from "./componetns/Footerres";
import Home from "./componetns/Home";
import Navbares from "./componetns/Navbares";
import 'bootstrap/dist/css/bootstrap.min.css';
import Addrestaurant from "./componetns/addRestaurants/Addrestaurant";




function App() {
  return (

    <div>
      <BrowserRouter>
        <Navbares />
        <Routes>
          <Route path="/Home" to={<Home />} />
          <Route path="/addres" to={<Addrestaurant />} />
        </Routes>
        <Footerres />
      </BrowserRouter>
    </div>


  );
}

export default App;
